using namespace std;

int main(){
    int n;
    cin >> n;
    int arr[n];

    for(int i=0; i<n; i++){
        cin >> arr[i];
    }

    int j=0;
    int gym=0;
    int contest=0;
    int rest=0;

    while(j<n){
        switch(arr[j]){
        case 0:
            rest++;
            gym=0;
            contest=0;
            break;
        case 1:
            if(contest!=0){
                rest++;
                gym=0;
                contest=0;
            }else{
                contest++;
                gym=0;
            }
            break;
        case 2:
            if(gym!=0){
                rest++;
                gym=0;
                contest=0;
            }else{
                gym++;
                contest=0;
            }
            break;
        case 3:
            int three=0;
            for(int k=j; arr[k]==3; k++){
                if(arr[k]==3) three++;
            }
            if(contest!=0 && gym==0){
                gym++;
                contest=0;
            }else if(gym!=0 && contest==0){
                contest++;
                gym=0;
            }else if(gym==0 && contest==0){
                if(arr[j+1]==1){
                    gym++;
                    contest=0;
                }else if(arr[j+1]==2){
                    contest++;
                    gym=0;
                }else if(arr[j+1]==0){
                    contest++;
                    gym=0;
                }else if(arr[j+1]==3){
                    if(arr[j+three]==1){
                        gym++;
                        contest=0;
                    }else if(arr[j+three]==2){
                        contest++;
                        gym=0;
                    }else{
                        contest++;
                        gym=0;
                    }
                }
                j=j+three;
                continue;
            }else{
                rest++;
                contest=0;
                gym=0;
            }

        }
        /*cout << contest << "\n";
        cout << gym << "\n";
        cout << rest << "\n";*/
        j++;
    }

    cout << rest << "\n";

}

#include <queue>
