#include <iostream>
#include <string>

using namespace std;

int main() {

    int num;
    cin >> num;

    for (int num1 = 1; num1 <= 9; num1++) {
        for (int num2 = 1; num2 <= 9; num2++) {
            for (int num3 = 1; num3 <= 9; num3++) {
                for (int num4 = 1; num4 <= 9; num4++) {
                    if (num % num1 == 0 && num % num2 == 0 && num % num3 == 0 && num % num4 == 0)
                    {
                        cout << num1 << num2 << num3 << num4 << " ";
                    }
                }
            }
        }
    }

    return 0;
}

#include <iostream>
#include <string>

using namespace std;

int main() {

    int juryCount, counter = 0;
    cin >> juryCount;
    cin.ignore();

    string command;
    getline(cin,command);
   
    double score = 0, totalAverage = 0;

    while (command != "Finish") {
        string presentation = command;
        double average = 0;

        for (int i = 0; i < juryCount; i++) {
            cin >> score;
            average += score;
        }

        printf("%s - %.2f.\n", presentation.c_str(), average / juryCount);
        totalAverage += average;
        counter++;
        cin.ignore();
        getline(cin, command);
    }

    printf("Student's final assessment is %.2f.\n", totalAverage / (counter * juryCount));

    return 0;
}

